import React from 'react';
import {
  Typography,
} from '@material-ui/core';

export default () => (
    <div>
        <Typography variant="h4">~Home~</Typography>
        <Typography variant="body1">
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed faucibus sollicitudin ligula, porttitor eleifend justo semper lacinia. Praesent lectus nisi, finibus id dui consectetur, consequat dictum est. Sed consectetur finibus mattis. Integer dui erat, tincidunt quis dolor vel, porta rhoncus ante. Morbi at urna pulvinar, aliquet nulla eget, iaculis ligula. Phasellus tristique bibendum consectetur. Vestibulum sem lacus, gravida in interdum in, facilisis porttitor odio. Suspendisse porttitor nisl odio, at lobortis dolor tempus at. Vivamus congue dolor risus, vitae lobortis ligula molestie eu. Ut sodales purus sit amet dictum congue. Vivamus cursus ultrices lorem, dignissim ornare quam molestie vitae. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia curae; Fusce vitae nibh mattis nunc lobortis sollicitudin quis ac diam. Nulla facilisi. In vehicula justo lobortis, maximus eros fermentum, pellentesque urna. Integer ac dapibus felis, non dignissim nunc.
            Sed ac leo eget elit faucibus lobortis ut in nisl. Proin eget porta neque, quis mattis libero. Cras lacinia, felis at dictum commodo, elit arcu eleifend elit, vitae placerat mauris sem eget lorem. Duis iaculis lacus erat, sed varius nunc finibus elementum. Etiam molestie vehicula mauris et consequat. Proin dignissim nec velit sed tincidunt. Donec dignissim urna metus. Praesent accumsan tempus libero, eget bibendum elit aliquet id. Quisque viverra mollis lacinia. Vivamus ut nisi sit amet ante ullamcorper iaculis.
            Ut quis risus a ipsum feugiat aliquet vitae sed risus. Etiam eleifend lectus nec magna commodo, sit amet mollis lacus bibendum. Integer id efficitur nisi. Phasellus rutrum imperdiet risus id gravida. Aenean tincidunt scelerisque justo, sit amet accumsan est dictum quis. Pellentesque sodales pretium diam, in accumsan diam dapibus at. Ut condimentum dolor eget augue sodales, id rutrum risus bibendum. Nullam interdum pulvinar magna vel efficitur. Nulla et elit ut magna ultricies ultricies. Fusce ut tempor nibh, sit amet egestas ex. Fusce condimentum, diam ut facilisis interdum, augue lacus efficitur neque, sed pretium felis arcu quis lectus. Nam gravida sem nec aliquet maximus. Sed bibendum accumsan nunc eget maximus.
            Suspendisse rutrum viverra dolor, sit amet ultrices erat. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia curae; Suspendisse luctus, lorem sed varius molestie, magna tortor pharetra est, at suscipit nisi ante eget massa. Nulla commodo, leo vitae luctus ultricies, neque dui viverra neque, vel maximus elit elit hendrerit tellus. Vivamus aliquet feugiat metus, eget mollis felis viverra nec. Mauris elit sapien, tristique eu nisi eu, ullamcorper facilisis magna. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Vivamus volutpat maximus velit at maximus.
            Ut pulvinar tempor felis, a volutpat diam sodales eget. Proin ultrices viverra efficitur. Donec vitae dictum felis, et tempor odio. Quisque ultrices in lectus nec fringilla. Donec ac lacus id metus hendrerit placerat id a elit. Vivamus aliquet magna nibh. Donec venenatis diam eu urna malesuada pulvinar.
        </Typography>
    </div>
);
